function AccountSetupViewModel(){var n=this;n.UserName=ko.observable();n.Email=ko.observable();n.CurrentPassword=ko.observable();n.NewPassword=ko.observable();n.ConfirmPassword=ko.observable();n.BusinessName=ko.observable();n.FullName=ko.observable();n.Address=ko.observable();n.City=ko.observable();n.State=ko.observable();n.Zip=ko.observable();n.TimezoneOffset=ko.observable();n.TimezoneOffsetValue=ko.observable();n.Load=function(){ShowLoader();$.ajax({type:"GET",url:webserviceURL+"reservationsetting",contentType:"application/json; charset=utf-8",success:function(t){n.UserName(t.data.UserName);n.Email(t.data.Email);n.BusinessName(t.data.BusinessName);n.FullName(t.data.FullName);n.Address(t.data.Address);n.City(t.data.City);n.State(t.data.State);n.Zip(t.data.Zip);n.TimezoneOffset(t.data.TimezoneOffset);n.TimezoneOffsetValue(t.data.TimezoneOffsetValue);$("#timezone").val(t.data.TimezoneOffsetValue);HideLoader()},error:function(n,t,i){HideLoader();ShowErrorMessage(n,t,i)}})};n.UpdateAccountSetup=function(){ShowLoader();n.TimezoneOffset($("#timezone option:selected").attr("data-offset"));n.TimezoneOffsetValue($("#timezone").val());$.ajax({type:"PUT",url:webserviceURL+"reservationsetting",data:{BusinessName:n.BusinessName(),FullName:n.FullName(),Email:n.Email(),CurrentPassword:n.CurrentPassword(),NewPassword:n.NewPassword(),ConfirmPassword:n.ConfirmPassword(),Address:n.Address(),City:n.City(),State:n.State(),Zip:n.Zip(),TimezoneOffset:n.TimezoneOffset(),TimezoneOffsetValue:n.TimezoneOffsetValue()},success:function(){$.notify("Account updated successfully.","success");HideLoader()},error:function(n,t,i){HideLoader();ShowErrorMessage(n,t,i)}})};n.Load()}$("body").addClass("preference_body account_setting_body accont_coms");$("#timezone").timezones();var accountSetupViewModel=new AccountSetupViewModel;ko.applyBindings(accountSetupViewModel);